#include "lr_pes_ch4_n2.hpp"

void LR_PES_ch4_n2::init()
{
    S = fillS(M_PI, M_PI/2.0, -3.0*M_PI/4.0);
}

Eigen::Matrix3d LR_PES_ch4_n2::fillSz(const double angle) {
    Eigen::Matrix3d S;

    S(0, 0) = std::cos(angle);
    S(0, 1) = std::sin(angle);
    S(0, 2) = 0.0;

    S(1, 0) = -std::sin(angle);
    S(1, 1) = std::cos(angle);
    S(1, 2) = 0.0;

    S(2, 0) = 0.0;
    S(2, 1) = 0.0;
    S(2, 2) = 1.0;

    return S;
}

Eigen::Matrix3d LR_PES_ch4_n2::fillSy(const double angle) {
    Eigen::Matrix3d S;

    S(0, 0) = std::cos(angle);
    S(0, 1) = 0.0;
    S(0, 2) = -std::sin(angle);

    S(1, 0) = 0.0;
    S(1, 1) = 1.0;
    S(1, 2) = 0.0;

    S(2, 0) = std::sin(angle);
    S(2, 1) = 0.0;
    S(2, 2) = std::cos(angle);

    return S;
}

Eigen::Matrix3d LR_PES_ch4_n2::fillS(const double alpha, const double beta, const double gamma) {
    return fillSz(alpha) * fillSy(beta) * fillSz(gamma); 
}

void LR_PES_ch4_n2::transform_angles(double ph, double th, double & phrot, double & throt) {
    Eigen::Vector3d v, vtr;
    v(0) = std::cos(ph) * std::sin(th);
    v(1) = std::sin(ph) * std::sin(th);
    v(2) = std::cos(th);

    vtr = S.transpose() * v;

    throt = std::acos(vtr[2]);
    phrot = std::atan2(vtr[1] / std::sin(throt), vtr[0] / std::sin(throt));
} 

double LR_PES_ch4_n2::pes(const double R, const double ph1, const double th1, const double ph2, const double th2)
{
    double ph1rot, th1rot, ph2rot, th2rot;

    transform_angles(ph1, th1, ph1rot, th1rot);
    transform_angles(ph2, th2, ph2rot, th2rot);

    return pes_rotated(R, ph1rot, th1rot, ph2rot, th2rot);
}

